title: Mutual recursion in a chain of inheritance
description: >
  The defect manifests in the form of call chain cycles.
  The following cycles are present here:
  o8632.m4 -> o8584.m20 -> o8584.m19 -> o8632.m29 -> o8584.m20
  o8632.m29 -> o8584.m20 -> o8584.m19 -> o8632.m29
  o8584.m20 -> o8584.m19 -> o8632.m29 -> o8584.m20
  o8632.m6 -> o8584.m20 -> o8584.m19 -> o8632.m29 -> o8584.m20
  o8584.m19 -> o8632.m29 -> o8584.m20 -> o8584.m19
  o8632.m15 -> o8584.m20 -> o8584.m19 -> o8632.m29 -> o8584.m20
  o8565.m13 -> o8562.m16 -> o8565.m23 -> o8562.m16
  o8565.m18 -> o8565.m23 -> o8562.m16 -> o8565.m23
  o8565.m4 -> o8562.m16 -> o8565.m23 -> o8562.m16
  o8565.m23 -> o8562.m16 -> o8565.m23
  o8565.m3 -> o8562.m16 -> o8565.m23 -> o8562.m16
  o8562.m16 -> o8565.m23 -> o8562.m16
  o8612.m22 -> o8635.m0 -> o8612.m11 -> o8635.m0
  o8612.m11 -> o8635.m0 -> o8612.m11
  o8635.m0 -> o8612.m11 -> o8635.m0

features:
  - inheritance
  - overriding
  - method
  - polymorphism

